Thus far, the previous tutorials have been building up an understanding of the Robot struct and its underlying modules in Optima. This struct only contains a model and configuration for a single robot (ur5, yumi, sawyer, etc.). However, what if we want to handle cases where our model may contain multiple robots . Optima handles this case by providing the RobotSet struct. A RobotSet can be thought of as a superset abstraction of the Robot struct. A RobotSet initialized with a single robot is indistiguishable from a Robot; however, it can also incorporate more robots into a single model when needed. IMPORTANT: Because the RobotSet struct is a superset of Robot, almost all downstream applications and algorithms in Optima will depend on a RobotSet instead of a Robot. Thus, it is highly recommended to always use a RobotSet in code, even when only one robot is present in the model, in order to maximimze compatibility throughout the library. Code that loads a RobotSet can be seen here: extern crate optima; use optima::robot_set_modules::robot_set::RobotSet;
use optima::utils::utils_robot::robot_module_utils::RobotNames; fn main() { // Loads a robot set with two robots (a ur5 and sawyer). let robot_set = RobotSet::new_from_robot_names(vec![RobotNames::new("ur5", None), RobotNames::new("sawyer", None)]); // prints a summary of the robot set configuration robot_set.robot_set_configuration_module().print_summary(); // prints a summary of the robot set's degrees of freedom. robot_set.robot_set_joint_state_module().print_dof_summary();
} The robot set loaded in line 8 has two robots, a ur5 and a sawyer. Both of these robots are their "base" configurations (i.e., the second parameter in both RobotNames structs are None). However, either of these could have been named configurations previously saved for either robot. The code for this tutorial can be found in the file optima_toolbox/optima/examples/0_load_robot.rs and can be run from the optima_toolbox/optima directory using the following command: cargo run --example 2_robot_sets The output of this example should be the following: Robot 0 ---> Link index: 0 Link name: base_link Present: true Link index: 1 Link name: shoulder_link Present: true Link index: 2 Link name: upper_arm_link Present: true Link index: 3 Link name: forearm_link Present: true Link index: 4 Link name: wrist_1_link Present: true Link index: 5 Link name: wrist_2_link Present: true Link index: 6 Link name: wrist_3_link Present: true Link index: 7 Link name: ee_link Present: true Link index: 8 Link name: base Present: true Link index: 9 Link name: tool0 Present: true Link index: 10 Link name: world Present: true >> Joint index: 0 Joint name: shoulder_pan_joint Num dofs: 1 Present: true -- Joint sub idx 0: Rotation about axis [[0.0, 0.0, 1.0]], Not fixed.
