14.body:
In the previous tutorial, we overviewed how to instantiate a robot set with multiple robots. In this case, both robot models were simply their "base" configurations; however, it is possible to build up unique configurations for all robots in the set using what is called a RobotSetConfiguration. In this section, we will show how to achieve this effect. Example code that instantiates a RobotSet using a RobotSetConfiguration can be seen here: extern crate optima; use optima::robot_modules::robot_configuration_module::{ContiguousChainMobilityMode, RobotConfigurationModule};
use optima::robot_set_modules::robot_set::RobotSet;
use optima::robot_set_modules::robot_set_configuration_module::RobotSetConfigurationModule;
use optima::utils::utils_robot::robot_module_utils::RobotNames;
use optima::utils::utils_se3::optima_se3_pose::{OptimaSE3Pose, OptimaSE3PoseType}; fn main() { // Initialize `RobotSetConfigurationModule` let mut robot_set_configuration_module = RobotSetConfigurationModule::new_empty(); // Load a base robot configuration module let mut ur5_configuration = RobotConfigurationModule::new_from_names(RobotNames::new_base("ur5")).expect("error"); // Set the ur5 to have a planar translation mobile base. ur5_configuration.set_mobile_base(ContiguousChainMobilityMode::PlanarTranslation { x_bounds: (-2.0, 2.0), y_bounds: (-2.0, 2.0) }).expect("error"); // Add the ur5 configuration to the robot_set_configuration robot_set_configuration_module.add_robot_configuration(ur5_configuration).expect("error"); let mut sawyer_configuration = RobotConfigurationModule::new_from_names(RobotNames::new_base("sawyer")).expect("error"); // Move the sawyer robot over 1 meter on the y axis so it is not overlapping with the ur5 robot. sawyer_configuration.set_base_offset(&OptimaSE3Pose::new_from_euler_angles(0.,0.,0., 0., 1., 0., &OptimaSE3PoseType::ImplicitDualQuaternion)).expect("error"); // Remove the pedestal from the sawyer model. sawyer_configuration.set_dead_end_link(2).expect("error"); // Add the sawyer configuration to the robot_set_configuration robot_set_configuration_module.add_robot_configuration(sawyer_configuration).expect("error"); // Similar to a `RobotConfigurationModule`, a `RobotSetConfigurationModule` can be saved to a file // to allow for easy loading of a model at a later time. This command will save a file // `optima_toolbox/optima_assets/optima_robot_sets/test_configuration.JSON` robot_set_configuration_module.save_robot_set_configuration_module("test_configuration").expect("error"); // We will now load the just saved configuration let loaded_robot_set_configuration_module = RobotSetConfigurationModule::new_from_set_name("test_configuration").expect("error"); // This loaded robot set configuration will now be used to initialize a `RobotSet`. let robot_set = RobotSet::new_from_robot_set_configuration_module(loaded_robot_set_configuration_module); // When we now print information about the robot set, the changes we made to the configurations // are reflected in the combined model. robot_set.print_summary(); robot_set.robot_set_configuration_module().print_summary(); robot_set.robot_set_joint_state_module().print_dof_summary();
} Explanations for the code above are written as comments line by line. The code for this tutorial can be found in the file optima_toolbox/optima/examples/3_robot_set_configurations.rs and can be run from the optima_toolbox/optima directory using the following command: cargo run --example 3_robot_set_configurations Note that, if this example is run, a directory called test_configuration will be saved in optima_toolbox/optima_assets/optima_robot_sets. Because this configuration will be used in future examples, please to leave this directory in place while you are going through tutorials. However, long-term, feel free to delete this directory. The output of this example should be the following: 2 robots. Robot 0 ---> "ur5" Base Offset: EulerAnglesAndTranslation { euler_angles: [[0.0, -0.0, 0.0]], translation: [[0.0, 0.0, 0.0]], phantom_data: ImplicitDualQuaternion { rotation: [0.0, 0.0, 0.0, 1.0], translation: [[0.0, 0.0, 0.0]], is_identity: true, rot_is_identity: true, translation_is_zeros: true }, pose_type: EulerAnglesAndTranslation } Robot 1 ---> "sawyer" Base Offset: EulerAnglesAndTranslation { euler_angles: [[0.0, -0.0, 0.0]], translation: [[0.0, 1.0, 0.0]], phantom_data: ImplicitDualQuaternion { rotation: [0.0, 0.0, 0.0, 1.0], translation: [[0.0, 1.0, 0.0]], is_identity: false, rot_is_identity: true, translation_is_zeros: false }, pose_type: EulerAnglesAndTranslation } Robot 0 ---> Link index: 0 Link name: base_link Present: true Link index: 1 Link name: shoulder_link Present: true Link index: 2 Link name: upper_arm_link Present: true Link index: 3 Link name: forearm_link Present: true Link index: 4 Link name: wrist_1_link Present: true Link index: 5 Link name: wrist_2_link Present: true Link index: 6 Link name: wrist_3_link Present: true Link index: 7 Link name: ee_link Present: true Link index: 8 Link name: base Present: true Link index: 9 Link name: tool0 Present: true Link index: 10 Link name: world Present: true Link index: 11 Link name: base_of_chain_link